import axios from "axios";
import React, { useCallback, useEffect, useState } from "react";
import images from "../../assets";
import {
  bayutUrl,
  fetchApi,
  rentOptions,
  saleOptions,
} from "../../utiles/fetchApi";
import BannerSections from "./bannerSections";
import constants from "./constants";
import PropertySection from "./sections";
import { HeaderContainer, PropertySectionInnerContainer } from "./styles";

export default function Home() {
  const [salePropertyArray, setSalePropertyArray] = useState([
    {
      title: "default 1",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 2",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 3",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
  ]);
  const [rentPropertyArray, setRentPropertyArray] = useState([
    {
      title: "default 1",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 2",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
    {
      title: "default 3",
      baths: "NA",
      rooms: "NA",
      price: "NA",
      image: "NA",
      externalID: "",
    },
  ]);

  const getResults = useCallback(async () => {
    const results = await fetchApi(
      `${bayutUrl}/properties/list?purpose=for-rent`
    );
    const searchData = results;
    console.log(results);

    setSalePropertyArray([
      {
        title: searchData.hits[0].title,
        image: searchData.hits[0].coverPhoto.url,
        baths: searchData.hits[0].baths,
        rooms: searchData.hits[0].rooms,
        price: searchData.hits[0].price,
        externalID: searchData.hits[0].externalID,
      },
      {
        title: searchData.hits[1].title,
        image: searchData.hits[1].coverPhoto.url,
        baths: searchData.hits[1].baths,
        rooms: searchData.hits[1].rooms,
        price: searchData.hits[1].price,
        externalID: searchData.hits[1].externalID,
      },
      {
        title: searchData.hits[2].title,
        image: searchData.hits[2].coverPhoto.url,
        baths: searchData.hits[2].baths,
        rooms: searchData.hits[2].rooms,
        price: searchData.hits[2].price,
        externalID: searchData.hits[2].externalID,
      },
    ]);
  }, []);

  useEffect(() => {
    getResults();
  }, [getResults]);

  return (
    <>
      <HeaderContainer />
      <BannerSections
        image={images.rentBanner}
        description={constants.rentProperty.description}
        title={constants.rentProperty.title}
        button={constants.rentProperty.button}
        link={constants.rentProperty.link}
      ></BannerSections>
      <PropertySectionInnerContainer>
        {rentPropertyArray.map((array) => {
          return (
            <PropertySection
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={Number(array.price)}
              image={array.image}
              link={`/search/property/${array.externalID}`}
            ></PropertySection>
          );
        })}
      </PropertySectionInnerContainer>

      <BannerSections
        image={images.buyBanner}
        description={constants.buyProperty.description}
        title={constants.buyProperty.title}
        button={constants.buyProperty.button}
        link={constants.buyProperty.link}
      ></BannerSections>

      <PropertySectionInnerContainer>
        {salePropertyArray.map((array) => {
          return (
            <PropertySection
              title={array.title}
              baths={array.baths}
              rooms={array.rooms}
              price={Number(array.price)}
              image={array.image}
              link={`/search/property/${array.externalID}`}
            ></PropertySection>
          );
        })}
      </PropertySectionInnerContainer>
    </>
  );
}
